import React from "react"
import image from "../styles/img/Vector.png"


// Titre, localisation et tag de chaque logement
export default function TagsNote(props){
    return (
      <div className="container_tags-note">
            <div className="tags">
                {props.tags.map((tag, index) => 
                    <p className="tag_description" key={index}>{tag}</p>
                )}
            </div>
            <img src={image} className="rating_stars" rating={props.rating} alt={props.rating}/>
      </div>
    )
}
